import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-white text-gray-900 p-10">
      <h1 className="text-4xl font-bold mb-4">Fayaud MEZATIO TSAFACK, Ph.D.</h1>
      <h2 className="text-xl font-semibold mb-6">Applied Mathematician & Data Scientist</h2>
      <p className="mb-4">Welcome to my professional portfolio website.</p>
      <a href="https://github.com/Fayaud" target="_blank" rel="noopener noreferrer" className="text-blue-600 underline">
        View my GitHub Projects
      </a>
    </div>
  );
}

export default App;
